    Посчитайте количество и сумму чисел, находящихся в промежутке [1213, 8310],
    которые делятся на 3 и не делятся на 23. Запишите в ответе сначала количество,
    затем сумму.
  input data:
  input file:
  answer: 2263 10777692
  solve text Python: |-
    None
  solve file Python:
  solve text Pascal: |-
    ﻿// Автор: Зубов Н.С.
    program n_1;
    var k,s,i:integer;
    begin
      k:=0;
      s:=0;
      for i:= 1213 to 8310 do begin
        if (i mod 3=0) and (i mod 23<>0) then begin
          inc(k);
          s:=s+i;
        end;
      end;
      writeln(k,' ',s);
    end.
